备注：以下发展过程出现，请不要纠结出现顺序 [捂脸]

- 库/框架：jQuery, backbone， angular，react，vue
- 模块化：commonjs， AMD(CMD), UMD, es module
- 任务管理器：npm scripts,  grunt, gulp
- 模块打包工具： r.js, webpack, rollup, browserify
