`yeoman`是一款强壮的且有一系列工具的通用型脚手架，但yeoman发布指定package名称，和用其开发工具。具体可[点击这里查看yeoman添加生成器规则](http://yeoman.io/generators/)

## 开发初衷和目标

由于金融公司形态决定了，业务类型多样，前端技术发展迭代，为了跟进社区发展，更好的完成下列目标而诞生。

